import React from "react";
import CreateUserContainer from "./CreateUserContainer";
import LoginContainer from "./LoginContainer";
import MoviesContainer from "./MoviesContainer";
import SingleMovieContainer from "./SingleMovieContainer";
import Footer from "./FooterContainer";
import NavBar from "./NavBarContainer";
import { Link, Switch } from "react-router-dom";
import { Router } from 'react-dom'

export default () => {
  return (
    <div>
      <Footer />
      <Switch />
      <Router path="/createuser" render={() => <CreateUserContainer />} />
      <Router path="/login" render={() => <LoginContainer />} />
      <Router path="/movies:id" render={({match}) => <SingleMovieContainer match={match} />} />
      <Router exact path="/movies" render={() => <MoviesContainer />} />
      <LoginContainer />
      <MoviesContainer />
      <SingleMovieContainer />
      <Switch />
      <NavBar />
    </div>
  );
};
